import React, { Component } from 'react';
import Loader from "react-loader-spinner";
import './Loader.css';

export default class App extends Component {
  //other logic
render() {
    return (
    <Loader
        className='loader'
        type="Puff"
        color="#ee9ca7"
        timeout={3000} //3 secs
    />
    );
}
}
